import React, { useContext } from 'react';
import { CommonContext } from '../../App';

export const AppContext = () => {

    const user = useContext(CommonContext);

    return (
        <div key={user.id}>
            <p>First Name: {user.firstName}</p>
            <span>Last Name: {user.lastName}</span>
        </div>
    );
};
